import React, { Component } from "react";
import { Route, Link } from "react-router-dom";
import Home from "./Home";

export default class App extends Component {
  render() {
    return (
      <>
        <Link to="/">Home</Link>
        <Route path="/">
          <Home />
        </Route>
      </>
    );
  }
}
